Scala has a special type of class called a case class that can be defined with the case class keyword. Unlike classes, whose instances are compared by reference, instances of case classes are immutable by default and compared by value. This makes them useful for defining rows of typed values in Spark. case class Point(x: Int, y: Int, z: Int) defined class Point Case classes can be instantiated without the new keyword. val point = Point(1, 2, 3)
val anotherPoint = Point(1, 2, 3)
val yetAnotherPoint = Point(2, 2, 2) point: Point = Point(1,2,3)
anotherPoint: Point = Point(1,2,3)
yetAnotherPoint: Point = Point(2,2,2) Instances of case classes are compared by value and not by reference. if (point == anotherPoint) { println(point + " and " + anotherPoint + " are the same.")
} else { println(point + " and " + anotherPoint + " are different.")
} // Point(1,2,3) and Point(1,2,3) are the same. if (point == yetAnotherPoint) { println(point + " and " + yetAnotherPoint + " are the same.")
} else { println(point + " and " + yetAnotherPoint + " are different.")
} // Point(1,2,3) and Point(2,2,2) are different. Point(1,2,3) and Point(1,2,3) are the same.
Point(1,2,3) and Point(2,2,2) are different. By contrast, instances of classes are compared by reference. myVaryingCuboid.printVolume() // should be 1 x 1 x 1 1 my1Cube.printVolume() // should be 1 x 1 x 1 1 if (myVaryingCuboid == my1Cube) { println("myVaryingCuboid and my1Cube are the same.")
} else { println("myVaryingCuboid and my1Cube are different.")
} // they are compared by reference and are not the same. myVaryingCuboid and my1Cube are different. More about case classes here: https://docs.scala-lang.org/tour/case-classes.html .

