"Functional programming is a style of programming that emphasizes writing applications using only pure functions and immutable values. As Alvin Alexander wrote in Functional Programming, Simplified, rather than using that description, it can be helpful to say that functional programmers have an extremely strong desire to see their code as math — to see the combination of their functions as a series of algebraic equations. In that regard, you could say that functional programmers like to think of themselves as mathematicians. That’s the driving desire that leads them to use only pure functions and immutable values, because that’s what you use in algebra and other forms of math." See https://docs.scala-lang.org/overviews/scala-book/functional-programming.html for short lessons in functional programming. We will apply functions for processing elements of a scala collection to quickly demonstrate functional programming. Five ways of adding 1 The first four use anonymous functions and the last one uses a named method. explicit version: (x: Int) => x + 1 type-inferred more intuitive version: x => x + 1 placeholder syntax (each argument must be used exactly once): _ + 1 type-inferred more intuitive version with code-block for larger function body: x => { // body is a block of code val integerToAdd = 1 x + integerToAdd
} as methods using def: def addOne(x: Int): Int = x + 1 Now, let's do some functional programming over scala collection (List) using some of their methods: map, filter and reduce. In the end we will write our first mapReduce program! For more details see: https://docs.scala-lang.org/overviews/scala-book/collections-methods.html map See: https://superruzafa.github.io/visual-scala-reference/map/ trait Collection[A] { def map[B](f: (A) => B): Collection[B]
} map creates a collection using as elements the results obtained from applying the function f to each element of this collection. // <Shift+Enter> to map each value x of lst with x+10 to return a new List(11, 12, 13)
lst.map(x => x + 10) res3: List[Int] = List(11, 12, 13) // <Shift+Enter> for the same as above using place-holder syntax
lst.map( _ + 10) res4: List[Int] = List(11, 12, 13) filter See: https://superruzafa.github.io/visual-scala-reference/filter/ trait Collection[A] { def filter(p: (A) => Boolean): Collection[A]
} filter creates a collection with those elements that satisfy the predicate p and discarding the rest. // <Shift+Enter> to return a new List(1, 3) after filtering x's from lst if (x % 2 == 1) is true
lst.filter(x => (x % 2 == 1) ) res5: List[Int] = List(1, 3) // <Shift+Enter> for the same as above using place-holder syntax
lst.filter( _ % 2 == 1 ) res6: List[Int] = List(1, 3) reduce See: https://superruzafa.github.io/visual-scala-reference/reduce/ trait Collection[A] { def reduce(op: (A, A) => A): A
} reduce applies the binary operator op to pairs of elements in this collection until the final result is calculated. // <Shift+Enter> to use reduce to add elements of lst two at a time to return Int 6
lst.reduce( (x, y) => x + y ) res7: Int = 6 // <Ctrl+Enter> for the same as above but using place-holder syntax
lst.reduce( _ + _ ) res8: Int = 6 Let's combine map and reduce programs above to find the sum of after 10 has been added to every element of the original List lst as follows: lst.map(x => x+10) .reduce((x,y) => x+y) // <Ctrl-Enter> to get Int 36 = sum(1+10,2+10,3+10) res9: Int = 36 Exercise in Functional Programming You should spend an hour or so going through the Functional Programming Section of the Scala Book: https://docs.scala-lang.org/overviews/scala-book/functional-programming.html Scala lets you write code in an object-oriented programming (OOP) style, a functional programming (FP) style, and even in a hybrid style, using both approaches in combination. This book assumes that you’re coming to Scala from an OOP language like Java, C++, or C#, so outside of covering Scala classes, there aren’t any special sections about OOP in this book. But because the FP style is still relatively new to many developers, we’ll provide a brief introduction to Scala’s support for FP in the next several lessons. Functional programming is a style of programming that emphasizes writing applications using only pure functions and immutable values. As Alvin Alexander wrote in Functional Programming, Simplified , rather than using that description, it can be helpful to say that functional programmers have an extremely strong desire to see their code as math — to see the combination of their functions as a series of algebraic equations. In that regard, you could say that functional programmers like to think of themselves as mathematicians. That’s the driving desire that leads them to use only pure functions and immutable values, because that’s what you use in algebra and other forms of math. Functional programming is a large topic, and there’s no simple way to condense the entire topic into this little book, but in the following lessons we’ll give you a taste of FP, and show some of the tools Scala provides for developers to write functional code. There are lots of methods in Scala Collections. And much more in this scalable language . See for example http://docs.scala-lang.org/cheatsheets/index.html .
